        <div>
        <p>edit box</p>
        <input type="text" placeholder="Name" onChange={(e)=>setname(e.target.value)} />
        <input type="text" placeholder="Skill" onChange={(e)=>setskill(e.target.value)} />
        <button>Update</button>
        </div>
    )
}
